import './Presentacion.css'

const Presentacion = () => {
    return (
        <div className="m-4">
            <div className="border mt-4">
                <div className="d-flex justify-content-start m-4 cont-text1">
                    <h3 className="text-light fs-4 m-4 text-center">Bienvenido a WorkScrum, la herramienta diseñada para llevar el control total de tus proyectos bajo la metodología SCRUM</h3>
                </div>
                <div className='d-flex justify-content-end m-4 cont-text2'>
                <h3 className="text-light fs-4 m-4 text-center">Bienvenido a WorkScrum, la herramienta diseñada para llevar el control total de tus proyectos bajo la metodología SCRUM</h3>
                </div>
            </div>
        </div>
    );
};

export default Presentacion;
